It has officially been a week since the @fabbodyretreat and I am just coming up for air after a miraculous experience.

A few months ago I was casually walking down the street, and a random woman stopped me and said “God told me to tell you that you are meant to help people”. It was just the confirmation I needed.

A week ago I curated and hosted the 5 year anniversary edition of the FabBody Retreat. The wellness experience took place on the beautiful island of Grenada for a group of 40 women.  In the era of the “soft life” movement where black and brown women are finding balance and prioritization between the stressful booked and busy/strong black woman life, and a life of self-care and ease, the #FabBodyRetreat was a life-changing wellness sojourn that boasted rejuvenation, service, healing and connection. People were healed, purpose partnerships were formed, and God was glorified. And I am excited and honored to do it again, year after year. My God-purpose is to help serve, connect and heal women. 💕

For a full journaled recap, check out the article from @theculturedcollective_ in my bio. 💗

